import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function BasicBars(lable1, lable2) {
  return (
    <BarChart
      xAxis={[{ scaleType: 'band', data: [lable1, lable2] }]}
      series={[{ data: [3, 5] }]}
      width={500}
      height={300}
    />
  );
}
